import React from "react";

import styles from './Services.module.css'

function Services() {
    const appServices = [
      { text: 'Customer Manager'},
      { text: 'Task Manager'},
      { text: 'Inspection Manager'},
      { text: 'Task Map'},
      { text: 'Quick Lockup'},
      { text: 'My Task'},
    ];
  
    return (
      <div className={styles.Services}>
        {appServices.map((appService) => (
          <button>
            {appService.text}
          </button>
        ))}
      </div>
    );
  }
